import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import Landing from './landing-page'
import HomePage from "./components/home";
import Popup from './landing-page'
import Subscribe from './components/subscribe-page'
import HomeSubscribe from "./components/home-subscribe";
import ProfilePage from "./components/profile";
import Book from "./components/detail";
function App() {

    return (
        <Router>

            <Routes>
                <Route exact path="/" element={<Landing />} />
                <Route exact path="/home" element={<HomePage />} />
                <Route exact path="/homesub" element={<HomeSubscribe />} />
                <Route exact path="/signin" element={<Popup />} />
                <Route exact path="/subscribe" element={<Subscribe />} />
                <Route exact path="/profile" element={<ProfilePage />} />
                <Route exact path="/bookdetail" element={<Boo />} />
            </Routes>

        </Router>

    );
}


export default App;
